package com.company.library_project.entity.profile;import com.company.library_project.entity.base.StringBaseEntity;import jakarta.persistence.Entity;import jakarta.persistence.Table;import lombok.Data;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;@Entity@Table(name = "email_address")@NoArgsConstructor@Setter@Getterpublic class EmailAddressEntity extends StringBaseEntity {    private String email;    private String password;    public EmailAddressEntity(String email, String password) {        this.email = email;        this.password = password;    }}